import React from "react";

const Contact = (props) => {
    console.log(props.match.params)
   const mappedData = props.data.map(a => (
    <div className="post-page-container">
      <div className="post-buttons">
        <button className="back-button">Back to Posts</button>
        <button onClick={()=>props.del(a.id)}className="delete-button">Delete Post</button>
      </div>
      <div className="post-content-container">
        <div className="post-title">
          <p>ID: {a.id}</p>
        </div>
        <div className="post-title">
          <p>Title: {a.title}</p>
        </div>
        <div className="post-category">
          <p>Category: {a.category}</p>
        </div>
        <div className="post-text">
          <p>Text:{a.text}</p>
        </div>
      </div>
    </div>
  )); 
  return <div>{mappedData}</div>;
};

export default Contact;
